import React from 'react';

const IncDec=()=>{
    return(
        <>
           <div className="main_div">
               <div className="center_div">
                   <div className="heading">
                        <h1>0</h1>
                   </div>
                   <br/>
                   <div className="btn_div">
                      <button>Inc</button>
                      <button>Dec</button> 
                   </div>
               </div>
           </div>  
        </>
    );
};
export default IncDec;
